package com.aka_post.domain;

public class StartAndEnd {
	private int start;
	private int end;
	
	public StartAndEnd() {
		// TODO Auto-generated constructor stub
	}
	public StartAndEnd(int start, int end) {
		// TODO Auto-generated constructor stub
		this.start = start;
		this.end   = end;
	}
	
	public int getStart() {
		return start;
	}
	public void setStart(int start) {
		this.start = start;
	}
	public int getEnd() {
		return end;
	}
	public void setEnd(int end) {
		this.end = end;
	}
}
